using System;\nusing System.Runtime.InteropServices;\n\n// Assuming 'result' is your COM object received from JavaScript\nobject result = ...; // Your COM object\n\nif (result != null)\n{\n    try\n    {\n        // Cast the COM object to an array of objects\n        Array comArray = (Array)Marshal.CreateWrapperOfType(result, typeof(Array));\n\n        // Convert each element in the COM array to a string and store in a C# array\n        string[] managedArray = new string[comArray.Length];\n        for (int i = 0; i < comArray.Length; i++)\n        {\n            managedArray[i] = Convert.ToString(comArray.GetValue(i));\n        }\n\n        // Use 'managedArray' as the resulting array of strings in C#\n        Console.WriteLine(managedArray[0]); // Output: First item from JavaScript\n        Console.WriteLine(managedArray[1]); // Output: Second item from JavaScript\n    }\n    catch (Exception ex)\n    {\n        // Log or handle exception appropriately\n        Console.WriteLine("Error converting COM array to managed array: " + ex.Message);\n    }\n}